import React from 'react';
import './Navbar.css';
import logo from '../../assets/logo.png';

const Navbar= ()=>{
   return (
        <nav>
            
          <img src={logo} alt="Logo" />
           
            <ul className="navbar-links">
                <li>Home</li>
                <li>Program</li>
                <li>About us</li>
                <li>Campus</li>
                <li>Testimonials</li>
                <li>Contact us</li>
            </ul>
          
        </nav>
    );
}

export default Navbar;
